g2:c.PROCEDURE.g2:a.TEXT:
text-corruption-test-inner() = (truth-value,text)
IT:class item;
ER: class error;
X: symbol;
t1,t2: text;
status : truth-value = false;
status-text : text; 
saved-results : sequence = sequence();
xx : structure; 
begin
    post " text-test start";
    
    for IT = each procedure do
        allow other processing;
        saved-results=insert-at-end(saved-results,structure(proc:IT,seq:"[sequence(IT)]"));
        begin
        X=symbol("@@[the text of IT]");
        end
        on error (ER)
            post " text-test [sequence(IT)]";
            delete ER
        end;
    end;
    
    for xx = each structure in saved-results do
        t1 = the seq of xx;
        t2 = "[sequence(the proc of xx)]";
        if compare-text(t1,t2) /= 0 then
            return true,"Text is corrupted: [t1] /= [t2]";
    end;
    
    post " text-test end";    
    return status,"";
end

text-corruption-test(node: class benchmark-node)
status : truth-value; status-text : text;

begin
    status, status-text = call text-corruption-test-inner();
    if status 
        then call fail(node, status-text)
        else call pass(node); 
end
